import React from "react";
import styled from "styled-components";

function Map() {
  return (
    <MainContainer>
      <Nav></Nav>
    </MainContainer>
  );
}

export default Map;
const MainContainer = styled.div`
  width: 100vw;
  height: 100vh;
`;
const Nav = styled.div`
  width: 100vw;
  display: flex;
  align-items: flex-start;
  justify-content: space-between;
  padding: 30px 0;
  border-bottom: 1px solid #a0a0a0;
`;
